import {useSelector} from "react-redux"

function Cart() {
    const cart = useSelector((state)=>state.cart);
  return (
    <div className="cart-container">
        <h2>Shpping Cart</h2>
    {cart.cartItems.length === 0 ? (
        <div>
            <p>Your Cart Empty</p>
            <a href="/">Start Shopping</a>
        </div>
    ):(<>
    
    </>)}
    </div>
  )
}

export default Cart
